In attempting to create an Angular 1.5 directive that uses the $compile service, I discovered that a new definition for JQuery.html was required so that the following code would work:

```
function ($compile: ng.ICompileService) {
        return {
            link: function (scope, element, attrs, controller) {
                var markup = "<input type='text' ng-model='sampleData'/> {{sampleData}}<br/>";
                var html = $compile(markup)(scope);
                angular.element(element).html(html); // without definition this causes a compile error.
            }
        };
    }
```

